  false,\n\t\"url\": null,\n\t\"notes\": \"CMAQ modeled total nitrogen deposition
  for California during 2002. Data are provided at two resolutions (4 and 36 kilometers)
  that were produced from different CMAQ model runs. The 4km resolution data extent
  covers the majority of the state. 36km data are provided only in those areas within
  California that were outside the 4km modeled extent. Some of the 36km polygons along
  the contact with the 4km data and the state line are truncated. Deposition values
  do not always make a smooth transition from 4 to 36km resolution. The deposition
  value for each cell is recorded as value in units of kilograms of nitrogen per hectare
  per year. CMAQ modeling supervised by Gail Tonnesen (UCR/Bourn College Of Engineering/Center
  for Environmental Reasearch and Technology). CMAQ modeling was conducted during
  2006. Cartography by Robert Johnson (UCR, Center for Conservation Biology) and funded
  by NSF through the Biocomplexity Project.\",\n\t\"license_title\": null,\n\t\"extras\":
